(107, 1033, 'Tagala, Iradi Yanggat', 'Dalire, Carmencita Bautista', 'Rev. Saturnino Gadingan', 'Aparri, Cagayan', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '1989', 'Laoag City Foursquare Gospel Church', '1990', 'Laoag City Foursquare Church', 'Because I love the Lord, I love to serve Him through the inspiration of the Holy Spirit and through the encouragement of our pastors and teachers in the bible school.', 'Before and after my graduation in CWC, naging great help ako sa Laoag City Foursquare Gospel Church tapos umuwi ako dito sa Cagayan at dito ako lalong nagenjoy sa ministry at dito ako nag pioneering at nagchurch planting.', 'Claveria Foursquare Gospel Church, Minanga Foursquare Gospel Church, San Antonio Foursquare Gospel Church (Apayao), New Hope Claveria Foursquare Gospel Church', 'Claveria Foursquare Gospel Church, Minanga Foursquare Gospel Church, San Antonio Foursquare Gospel Church (Apayao), New Hope Claveria Foursquare Gospel Church, First Pamplona Foursquare Gospel Church', 'N/A', 'yes', 'N/A', 'ATP - 1994\r\nCWC - 1995, 1996, 1998\r\nLM - 1999-2020', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Through Love Gifts, District Assistance, Pastor\'s Allowance.', 'yes', 'By grace through faith in Jesus Christ.', 'I believe there are 3 Persons in One God - Father, Son and Holy Spirit.', 'My Salvation is secured in Jesus Christ since I believed in Him as my LORD and Savior.', '2020-10-15 16:41:21', 'Accepted', NULL, 'October 16, 2020 6:27:am  ', 'Submitted', NULL, NULL, 'District Interview is finished.  Congratulations, you passed.'),
(106, 1035, 'Valeriano Pacris Sr.', 'Felicisima Dabalos', '', '', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'Others', '1987', 'Living Temple Foursquare Church', '1987', 'Living Temple Foursquare Church', 'By the time that I was baptized in the water in early 1987, I felt in my heart to join the bible students of HLBC in the Campus Ministry until such time that I received the baptism of the Holy Spirit then I answered the call to teach. I attended seminars and trainings about Campus Ministry. Late 1987, I was installed as teacher of the Campus Ministry then received my credential authority to teach. As the years passed by, I was in the Campus Ministry at the same time assisted in the Sunday School', 'When I graduated in CMS 1998, we work together in the church ministry. I handled the children\'s ministry as well. We work hand and hand in Evangelism and Church Planting. We launched out to the mountainous area to start a tribal ministry too. As the Evangelism spread out, we pioneered the Cabalebaan Four Square Church. And I was assigned to be the pastor. When the program of the National to connect highways, I and Ptr. Jerry pioneered the Church On The Highway Four Square Church Sanchez Mira. ', 'Bangan Four Square Church.\r\nCabalebaan Four Square Church.\r\nChurch On The Highway Four Square Church Sanchez Mira.\r\nFirst Canalasan Four Square Church.', 'Bangan Four Square Church.\r\nCabalebaan Four Square Church.\r\nChurch On The Highway Four Square Church Sanchez Mira.\r\nFirst Canalasan Four Square Church.', 'NO.', 'yes', 'NO.', 'ATP - 1987-1998\r\nCW - 1999-2010\r\nLM - 2011-2020', 'NO.', 'NO.', 'yes', 'yes', 'yes', 'yes', 'yes', 'From the 40% of the net from the Tithes and Offering of the Church. And Assistance from the District love gift from the members, Cash and In Kind. My daughter and son are in charged of my Electric and Water Bills including the Internet and some other needs.', 'yes', 'By grace through faith in JESUS.', 'I believed there are three Persons in One GOD - Father, Son and Holy Spirit.', 'My Salvation is secured In Jesus Christ. Since I believed in HIM as my LORD and SAVIOR.', '2020-10-15 06:08:48', 'Accepted', NULL, 'October 15, 2020 2:33:pm  ', 'Submitted', NULL, NULL, 'District Interview is done.  Congratulations, you passed.'),
(105, 1048, '', '', '', '', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', '', '', '', '', '', '', '', 'N/A', '', 'N/A', '', '', '', 'N/A', 'N/A', '', '', '', '', '', '', '', '', '', '', '2020-10-15 00:30:12', 'Denied', NULL, '', '', NULL, NULL, 'This is part of the process undertaken as a sample for the filling up by the applicants.'),
(104, 1035, '', '', '', '', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'CMS', '1987', 'Living Temple Foursquare Church', '1987', 'Living Temple Foursquare Church', 'By the time that I was baptized in the water in early 1987, I felt in my heart to join the bible students of HLBC in the Campus Ministry until such time that I received the baptism of the Holy Spirit then I answered the call to teach. I attended seminars and trainings about Campus Ministry. Late 1987, I was installed as teacher of the Campus Ministry then received my credential authority to teach. As the years passed by, I was in the Campus Ministry at the same time assisted in the Sunday School', 'When I graduated in CMS 1987, we work together in the church ministry. I handled the children\'s ministry as well. We work hand and hand in Evangelism and Church Planting. We launched out to the mountainous area to start a tribal ministry too. As the Evangelism spread out, we pioneered the Cabalebaan Four Square Church. And I was assigned to be the pastor. When the program of the National to connect highways, I and Ptr. Jerry pioneered the Church On The Highway Four Square Church Sanchez Mira. As', 'Bangan Four Square Church.\r\nCabalebaan Four Square Church.\r\nChurch On The Highway Four Square Church Sanchez Mira.\r\nFirst Canalasan Four Square Church.', 'Bangan Four Square Church.\r\nCabalebaan Four Square Church.\r\nChurch On The Highway Four Square Church Sanchez Mira.\r\nFirst Canalasan Four Square Church.', 'NO.', 'yes', 'NO.', 'ATP - 1987-1998\r\nCW - 1999-2010\r\nLM - 2011-2020', 'NO.', 'NO.', 'yes', 'yes', 'yes', 'yes', 'yes', 'From the 40% of the net from the Tithes and Offering of the Church. And Assistance from the District love gift from the members, Cash and In Kind. My daughter and son are in charged of my Electric and Water Bills including the Internet and some other needs.', 'yes', 'By grace through faith in JESUS.', 'I believed there are three Persons in One GOD - Father, Son and Holy Spirit.', 'My Salvation is secured In Jesus Christ. Since I believed in HIM as my LORD and SAVIOR.', '2020-10-15 13:06:57', 'Denied', NULL, '', '', NULL, NULL, 'duplicated...need to delete this application of candidate'),
(103, 2087, 'Crisente S. Mancao Sr. (Deceased)', 'Imelda C. Mallorca', 'Rev. Brendo S. Medina', 'Davao City Foursquare Gospel Church, Davao City, Davao Del Sur', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '1998', 'Lampayan, Matalam, North Cotabato', '2002', 'Makilala, North Cotabato', 'May 2004, during the Midwest Mindanao District Youth Camp, I felt God was calling me in the ministry through the preaching of a Bible School Teacher/Pastor and responded to the challenge. June at the same year, I enrolled at Halls of Life Bible College.', 'On my 4th year as student of Halls of Life Bible college, I became the pastor of Upper Ilang Foursquare Gospel Church. Bu God\'s grace until the present, I, with my wife and children, continues in the ministry on the same church.', 'N/A', 'None', 'N/A', 'yes', 'NO', 'LM: 2009 to present', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Ministry is supported by faithful church members.', 'yes', 'A person must believe that Christ was sent, suffered and died for the redemption of our lives from sin and accept Him as personal Lord and Savior (John1:12). We are saved by grace through faith (Ephesians 2:8,9)', 'God the Father, God the Son and God the Holy Spirit are equal in power but have specific works and manifestation.', 'The moment a person accepts Jesus Christ as his/her personal Lord and Savior, this guarantees his/her eternal life (Acts 16:31). This can be lose the moment a person chose to turn away from the Lord Jesus Christ (John 15:5-6)', '2020-11-06 15:21:11', 'Accepted', NULL, 'November 10, 2020 10:48:am  ', 'Submitted', NULL, NULL, 'Congratulations! You have passed the District Interview and is qualified to take the examination on first week of January 2021!'),
(150, 1123, 'Isidro Silvan Perucho', 'Adeliada Fabula Alcoran', 'Rev. Celso Selodio', 'Odiongan Foursquare Church', '', '', '', '', '', '', '', '', '', 'BTh', '1983', 'Panique Foursquare Church', '1984', 'Church of God', 'Year 1985 I feel that I\'ve been  called by  God so  I involved  my self in teaching in  Sunday school, at  that  time I consider my self as a Sunday school teacher and I enjoyed that ministry. As young people I  was involved also in  youth ministry as a  secretary. during that time I attended the summer youth camp held  at Alcantara National High School and during altar call of OFBC night, I have decided to forward as  response to the calling of God  to  be a  minister.', 'After graduation, I\'ve been a pastor in Agape Christian Fellowship, at  the  same time I continued my studies in FBC project 4 Quezon city. and after my graduation, I resumed  my studies in Romblon  State University and took up BEED, my ministry continued in Odiongan Christian School as monitor Teacher. After my graduation in my  college course, i  focused my ministry  in Pastoring since  1986 up to the present.', 'Canlabha Foursquare Church', 'Canlabha Foursquare Church', 'NO!', 'yes', 'NO!', 'LM- since 1994- Present', 'NO!', 'NO!', 'yes', 'yes', 'yes', 'yes', 'yes', 'By Faith and from the church share', 'yes', 'I believe in by Grace not by works.\r\nBelief in the saving grace of the Lord Jesus Christ and accepting Him as Lord and Saviour.\r\n', 'I believe in:\r\nGod  the Father\r\nGod the  Son\r\nGod  the Holy Spirit\r\n The three in one Godhead.\r\n', 'Based on the efficacy of Jesus\' shed blood for us, we are secured eternally. We must live in accordance with the will of God according to the Bible.  and serve Him faithfully.', 'November 9, 2020 10:17:am  ', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
(102, 2075, 'Aurelio Catarena Laluna Sr.', 'Rosalinda Danda Montero', 'Rev. Wilfredo Castillo', 'Davao City Foursquare Gospel Church, Davao City, Davao Del Sur', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '1996', 'Tibungco FGC', '1992', 'San Juan Beach', 'When I attend Treasure Hunting for God in Mawab ComVal Province before, we went home empty handed. While waiting the bus for transportation going home, I saw an old woman sewing duster and I heard someone shouted on the 2nd floor of her home, her son whom is crippled and was murmuring to God why he was made crippled when he was a good guy. The guy went to his mother and sat beside her. Then I saw their bodies turn into gold and the Lord spoke into m heart, this is the real gold, which is their s', 'When I graduated last 2008, I was assigned to Bunawan Foursquare Gospel Church  which is now called Living Hope FGC. It was God\'s timing that Rev. Yul C. Balaga died and the church was in need of a new pastorate. From then on, I, together with my wife and children, ministered until present on the same church with the grace of God.', 'N/A', 'None', 'N/A', 'yes', 'No', '2008 to Present: LM', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Ministry is supported by church members and friends.', 'yes', 'Believe and receive by faith, the only God Son, the Lord Jesus Christ.', 'The Father working in the Old Testament, in other words His dispensation. And the Lord Jesus Christ manifest in the New Testament and when He ascended to heaven, He sent the Holy Spirit to be our comforter and sealed in the last days. That is what I believe.', 'Personally, when I accept the Lord Jesus Christ as my Lord and Savior, I am eternally secured.', '2020-11-06 15:07:41', 'Accepted', NULL, 'November 10, 2020 10:22:am  ', 'Submitted', NULL, NULL, 'Congratulations! You have passed the District Interview and is qualified to take the examination on first week of January 2021!'),
(101, 2157, '', '', 'Rev. Henry H. Lagumbay', 'Davao City', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'SMC', '1993', 'Elizalde, Maco, Davao De Oro', '1995', 'Tagbarus Foursquare Gospel Church', 'I am happy to be part of this ministry where God called me. Not because of money or wealth but because of His calling that I want to obey Him faithfully until the day of His coming. investing in God\'s kingdom that was my mindset of being God\'s servant and win more souls for God\'s glory...', 'Assisting at Damazo Suazo Foursqaure Gospel Church and presently I\'m Pastoring At Indangan Foursqaure Gospel Church', 'No', 'River\'s Of Joy Foursqaure Gospel church', 'No', 'yes', 'No', '2003 up to Present', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'With my Wife and all Church members', 'yes', 'Believed the Lord Jesus Christ and accept Him as our Lord and Savior. (John 3:16; John 1:12)', 'God The Father\r\nGod the Son\r\nGod the Holy Spirit\r\n(1 Corinthians 8:6; 2 Corinthians 3:17)', 'We will have eternal security once we believed and received Christ as our Lord and savior but this eternal security will become neglected if we will not work out of it. so those who are saved must Work hard to show the results of our salvation. Because faith without action is Dead.\r\n(Philippians 2:12; James 2:26; John 3:3)', '2020-10-19 11:56:51', 'Accepted', NULL, 'November 10, 2020 10:40:am  ', 'Submitted', NULL, NULL, '	Congratulations! You have passed the District Interview and is qualified to take the examination on first week of January 2021!'),
(100, 898, 'Fortunato Fallasgon', 'Crisanta Garcia', 'Rev. Norberto Doromal', 'San Andres, Romblon', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '1979', 'Odiongan Foursquare', '1983', 'Camp Central Elementary School', 'Ever since I am in highschool, I had a dream to be a servant of God. And so I pursue in Bible School as working student in Odiongan Bible College.', 'I am a pioneer Pastor at Pag-alad Foursquare Church for 12 years. Transferred in Baito for 6 years as head pastor and 4 years in Tubigon. And now I am in Renewed Life for 6 years. One year of being a Superintendent of Kapayapaan Division.', 'Pag-ulod Foursquare Gospel Church San Andres, Romblon', 'Baito Foursquare Church\r\nTubigon Foursquare Church\r\nRenewed Life Foursquare Church', 'No.', 'yes', 'No.', '1987-present', 'No.', 'No.', 'yes', 'yes', 'yes', 'yes', 'yes', 'My family and members of the church support my ministry.', 'yes', 'By grace, I have been saved through Faith and that not of ourselves. It is the gift of God.', 'I believe that there is one God in the unity of the God head. There are three equal and Divine the Father, the Son and the Holy Spirit.', 'We have eternal Security because Jesus Christ saved us. He alone can give us eternal security.', '2020-10-21 15:56:55', 'Accepted', NULL, 'December 14, 2020 9:51:am  ', 'Submitted', NULL, NULL, 'Ptra K will personally give remarks'),
(99, 781, 'Andres Cruz San Pedro', 'Lucila Marces Villamor', 'Rev. Gilbert Maghirang', 'Marikina Foursquare Church', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '1977', 'Davao City', '1980', 'Davao City', 'I love to read the bible and to know more about my God, and want to share to others that they may experience the fullness of His Spirit that I have.  And I started to hate sin and walk in life pleasing to God.', 'Sunday School Teacher; Bible Study Leader; Church Deacon; Church Council; Associate Pastor. And I love doing those things..', 'N/A', 'Capitol City Foursquare Church', 'N/A', 'yes', 'No.', '2006', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'By the membership', 'yes', 'Salvation is by the grace of God alone, through faith and manifested with godly character and love for the truth. \"For by grace you have been saved through faith. And this is not your own doing; it is the gift of God, not a result of works, so that no one may boast. For we are his workmanship, created in Christ Jesus for good works, which God prepared beforehand, that we should walk in them.\" Ephesians 2:8-10', 'One God in three person with equal power..One God and One Only \r\nExists in three Persons, Equal and Eternal ,Worthy of equal praise and worship, Distinct yet acting in unity, Constituting the one true God of the Bible ', ' Nobody can snatch us from the hands of God. \"And you also were included in Christ when you heard the message of truth, the gospel of your salvation. When you believed, you were MARKED IN HIM WITH A SEAL, the promised Holy Spirit, who is a DEPOSIT GUARANTEEING OUR INHERITANCE until the redemption of those who are God’s possession—to the praise of his glory.\" Ephesians 1:13-14', '2020-10-19 15:31:10', 'Accepted', NULL, 'December 14, 2020 9:56:am  ', 'Submitted', NULL, NULL, 'Ptra K will personally give remarks'),
