the Holy Trinity\r\n\r\n1 John 5:7 For there are three that bear record in heaven, the Father, the Word, and the Holy Ghost: and these three are one.', 'I believe that once a person truly believed and have faith in his heart in accepting Jesus as his Lord and personal Savior he saved.', 'October 16, 2020 3:21:pm  ', 'Accepted', '2020-10-20', 'October 21, 2020 12:19:pm  ', 'Submitted', NULL, NULL, 'accepted'),
(109, 3318, 'Valeriano P. Duallo', 'Graciana Jinesan Hagotin', '', '', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '2000', 'HLBC, Lopez Jaena St., Davao City', '2001', 'HLBC, Lopez Jaena St., Davao City', 'I dreamt of dead fishes and the meaning was explained to me that the fishes are souls. It was then that I realized I was called to become instrument in saving those souls.', 'After graduation I ministered as host pastor at Piapi Foursquare Gospel Church for 8 months. Afterwards I ministered as Sunday School Department Secretary/Treasurer and Teacher at Davao City Foursquare Gospel Church until I became host pastor at Anonang Foursquare Gospel Church in 2004.', 'I was part of the pioneering team for Del Monte Foursquare Gospel Church.', 'Del Monte Foursquare Gospel Church', 'N/A', 'yes', 'No,', '2003-present LM', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'My ministry is supported by my family, friends and church members.', 'yes', 'To receive Jesus Christ as personal Lord and savior.', 'We believe in one God presenting (gipadayag) Father, Son and Holy Spirit.', 'We gain eternal security through our faith in Jesus and continuation of being a faithful follower to God.', '2020-11-12 15:31:28', 'Accepted', NULL, 'November 12, 2020 3:48:pm  ', 'Submitted', NULL, NULL, 'Congratulations! You have passed the District Interview and is qualified to take the examination on first week of January 2021!'),
(156, 1713, 'Barnillo, Arnel Diego', 'Barnillo, Elena Paran', 'Rev. Salvador S. De Guzman', 'Sanitary Function Hall, Nabunturan, Comval, Province', '', '', '', '', '', '', '', '', '', 'CMS', '2005', 'in High School time', '2006', 'coronon (in youth camp)', 'nag- start ang calling ko sa pagmiminister noong 3rd year high school palang ako may campus ministry sa school namin noon. kay sinubukan kung sumali, at nang naranasan ko ang kapangyarihan ng Dios doun ko nalalaman na pinili pala ako nang Dios for ministry. at doun ko rin nalaman na may calling ako to preach the gospel. pagkatapos ko sa high school nagdecide ako na papasuk ako sa bible school, samadaling salita naka graduate ako nang bible school, apply nang pastor sa taon na 2010 nanggang ngayo', 'i became a skc counselor in skc camp in that year and then next is pastoring.', '', 'OPEN DOOR FOURSQUARE GOSPEL CHURCH/CATEEL F.G.C./CACAO F.G.C.', 'NO.', 'yes', 'NONE', 'ATP- 2010\r\nCW- 2011-2013\r\nLM- 2014-2020', 'NO.', 'NO.', 'yes', 'yes', 'yes', 'yes', 'yes', 'through financial support and pledges  of the members.', 'yes', 'Grace alone can save a lost human. as the bible teach us that:  for ti is by grace you have saved, through faith- and this is not from yourselves, it is the gift of God. eph. 2:8 (from v.4 to v.8) tit. 3:5-7.', 'we believe a triune God. we believe God the Father a sovereign God, Creator of universe, we believe the son Jesus savior of the lost humanity, and we believe a Holy ghost a 3rd person of trinity a promise power to every believer to endure trials and persecutions, to gave us strength to face a hardship through the power of holy Spirit.', 'according to the book of john and even Paul in 1 Thess. we have a blessed hope, and that hope is a promise eternal life and heaven which our final home. john 14:2-4', 'November 17, 2020 1:26:pm  ', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
(110, 2889, '', '', 'Rev. Valentin Chaves', 'Apas, Lahug Cebu City', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', '', '2008', 'Cebu City', '2008', 'Cebu Ciity', 'It was not a one time event, but rather a gradual process of God constantly pouring out His grace that I couldn\'t resist His call. I basically know in  my heart that God has called me to serve him but I was still struggling when will I decide, until God has put me in a situation where saying no is impossible. God\'s grace is surely powerful and his will is always done. ', 'After I graduate from USJR I served as an assistant pastor/youth pastor at Lapu-lapu Foursquare Church with my father (Rev. Rewel D. Buctuan) as the senior pastor. Under the leadership of my father, I was able to lead youth groups and bible studies for 7 years. On August 2018, my father decided to focus on his supervisory and installed me as the senior pastor of Lapu-lapu Foursquare Church.\r\n\r\n\r\n\r\n', 'If the word church means the called out ones, then I can say that God has used me to pioneer cell-groups and bible studies in numerous places in Lapu-lapu city (Bangkal, Pusok, Timpolok, Kalawisan and Kinalumsan. But if \"church\" means an established foursquare local church, then none.\r\n\r\n\r\n', 'I don\'t know what this question really means, we don\'t evangelize the church but we evangelize the lost.\r\n\r\n', 'N/A', 'yes', 'Yes I practically believe that a pastor should also have their way of generating money outside of the support from the church, and since I am academically educated, I have to use it to support my family and ministry \r\n\r\n', '5 years Christian worker and 2 years as a Licensed Minister\r\n', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Supported by the local church and my work.', 'yes', 'We are saved by grace through faith, this is not of ourselves but a gift from God, not of our works.\r\nAll saving work is done by God through Christ. ', 'I believe there is one God in three person. I reject any doctrine that denies this (e.g. Arianism, JW\'s, Iglesia ni Manalo, etc)', 'I believe God sovereignly saves his choosen people and when God saves no can\r\nsnatch them away. Our salvation is eternally secured in Christ and God will keep on doing good things in us so that we will not turn away from Him. ', '2020-10-15 18:56:28', 'Accepted', '2020-10-29', 'October 29, 2020 11:11:am  ', 'Submitted', NULL, NULL, 'for national processing'),
