(120, 673, '', '', '', '', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', '', '2007', 'ABU DHABI', '2014', 'ICCF', 'I\'ve been serving the Lord Jesus Christ in the music ministry for quite some years when the burden shifted from playing the instruments to preaching the Gospel and for the caring of souls, indeed it was being confirmed both by visions and Scriptures until finally ICCF Foursquare Gospel Church came into existence of which your servant now is the Senior Pastor installed by our Zambasul District  Supervisor Rev. Ricky C. Andajao.', 'by the time i graduated from from my CMS in the Halls of Life of Bible  College Zamboanga City  extension, i was at that time doing jail ministry and at the same time appointed to be the UFM Zambasul District President until the Pioneering of ICCF Foursquare Gospel Church.', 'ICCF  ( Immanuel City Center Fellowship ) Foursquare Gospel Church', 'Only ICCF for now.', 'No. ', 'yes', 'No.', '2013-2015 ATP\r\n2016-2020 CW', 'No. ', 'No. ', 'yes', 'yes', 'yes', 'yes', 'yes', 'ICCF Foursquare Gospel Church is being supported and sustained through the Tithes, Offerings and pledges both by members and supporters.', 'yes', 'Through and by Faith only in Jesus Christ.', ' I believe in the Triune God. One God three divine Person.God the Father,God the Son and God the Holy Spirit.', 'I believe in once save always save if you stay save.( Rom 11: 22 )', '2020-10-21 11:57:46', 'Denied', NULL, '', '', NULL, NULL, 'Doesn\'t  comply with the qualification: Credential is CW and Less than 10years in the ministry'),
