(160, 2029, 'LEON O. TIBIO', 'RAMONITA FERNANDEZ GADON', 'REV. JOEL GARCIA', 'ROXAS FOURSQUARE CHURCH', '', '', '', '', '', '', '', '', '', '', '1970', 'ROXAS FOURSQUARE CHURCH', '1978', 'ROXAS FOURSQUARE CHURCH', 'Since I received the baptism of the Holy Spirit, I feel the calling of God to the ministry. I served 8 years in the missionary work before I went to Bible School. Until now I served 35 years in the ministry as a Pastor.', 'I started ministering pioneering churches stated below. Lately we are ministering Grace Foursquare Gospel Church since 1987 up to present. It is almost 35 years in the service.', 'Canduyong Foursquare Gospel Church - Odiongan, Romblon\r\nPajo Foursquare Church - Calapan Oriental Mindoro\r\nBarayong Foursquare Church - Manaul, Mansalay\r\nGrace Foursquare Church - Del Mundo, Mansalay\r\n', 'Canduyong Foursquare Gospel Church - Odiongan, Romblon\r\nPajo Foursquare Church - Calapan Oriental Mindoro\r\nBarayong Foursquare Church - Manaul, Mansalay\r\nGrace Foursquare Church - Del Mundo, Mansalay', 'No', 'yes', 'No', 'LM - 1987 to present', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'through tithes and offerings', 'yes', '- We believe that Jesus Christ is my Savior, the Healer, Baptizer of the Holy Ghost, the Second Coming King\r\n- We believe that we are saved by grace through faith', '- We believe in God the Father, the Creator\r\n- We believe Jesus Christ died for our sins\r\n- We believe the Holy Spirit - the baptizer of the Holy Ghost', 'Once you received Jesus Christ as your personal Savior you have eternal life. And continue living a born again experience live a holy life - you have eternal security.', 'March 31, 2021 1:04:pm  ', 'Accepted', NULL, 'April 8, 2021 11:17:am  ', 'Submitted', NULL, NULL, 'Congratulations!\r\nYou passed the interview.');
