(161, 2030, 'FRANCISCO LADRERA', 'GLORIA VILLAMIN RAYMUNDO', 'REV. JOEL GARCIA', 'ROXAS FOURSQUARE CHURCH', '', '', '', '', '', '', '', '', '', '', '1982', 'ROXAS FOURSQUARE CHURCH', '1982', 'ROXAS FOURSQUARE CHURCH', 'I decided to study in Bible College because I want to minister. I believe that Pastoring is a highest calling, and I step in the ministry because I feel burden to the lost - I believe, I was called by God.', '- Pajo Foursquare Church, Canubing, Baco\r\n- Barayong Foursquare Church, Manaul, Mansalay\r\nI step in already in Pastoral right after graduation', '- Pajo Foursquare Church, Canubing, Baco\r\n- Barayong Foursquare Church, Manaul, Mansalay', '- Grace Foursquare Gospel Church\r\n- Biga Foursquare Gospel Church\r\n- Pajo Foursquare Church, Canubing, Baco\r\n- Barayong Foursquare Church, Manaul, Mansalay', 'No', 'yes', 'Government Employee - as an additional income to support the schooling of my children (contractual employee of LGU Mansalay)', 'LM - 1988 to present', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'through tithes and offerings and personal livelihood', 'yes', '- we are saved by grace through faith\r\n- Jesus Christ is the way, the truth and the life', 'I believe in God. He is the highest and owner of everything in the universe including my life.', 'Once that you believe in Jesus Christ as your personal Savior and Lord, you are saved. ', 'March 31, 2021 1:26:pm  ', 'Accepted', NULL, 'April 8, 2021 11:23:am  ', 'Submitted', NULL, NULL, 'Congratulations!\r\nYou passed the interview.'),
