(114, 3667, 'Rev. Domingo R. Calisang', 'Rev. Leah D. Calisang', 'Ptrs. Domingo/Leah Calisang', 'GNT - Zamboanga City', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'Others', '1978', 'Church', '1986', 'Youth Camp', 'At first I just want to be a part of Praise & worship team, although there were words of admonition about my calling by my parents, Missionaries, & even Nanay Thompson herself, & also from a Pastor I\'ve met in Israel last 2007. I just ignored all & went abroad with the Band. Until Dec. 2009 when we had a Gig in Baguio for Dep-Ed, there I just feel empty, & lonely then I recall every words that were said. So I said, Lord, if it\'s You just do Your will, yes! He did, then my outlook in life was cha', 'I served as the youth Pastor and lead the Praise and Worship team at Green Pasture Church headed by Rev. Ricky Andajao. Did Radio ministry and Doing Praise and Worship and Preaching in some Churches, Foursquare and none Foursquare.', 'N/A', 'Good News Temple foursquare church, ICCF foursquare church, Korban foursquare church, Zambowood foursquare church, Tictapul foursquare church, Jupiter foursquare church, Guilinan foursquare church, Libertad foursquare church, Ipil foursquare church, Word for the World Christian Fellowship, Jesus reigns ministry, Zamboanga Pastors Association, Radio Ministry, SINGSpiration ministry (a family ministry-live streaming on FB)', 'N/A', 'no', 'business for additional  financial support for the family.', 'ATM- 2013\r\nCW - 2015', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Thru the giving of tithes and offerings of church members and thru love gifts and help from supporters and friends.', 'yes', 'Salvation can only be obtain through Jesus Christ our Lord, by confessing that He is the only begotten Son of God who died on the cross and rose again the 3rd day and His precious blood that was shed to redeemed us from all sin, wickedness, and unrighteousness. He is the Way the Truth and the Life no one comes to the Father but through Him.', 'I believe in God the Father, I believe in God the Son, I believe in God the Holy Spirit. There are three person but only One God, the creator of the Universe, eternal, holy, loving, all-powerful and deserve our praise.', 'He/She can only have eternal security if and only if he/she will remain faithful, righteousness, keeps his/her salvation by not forsake his/her confidence of faith in Christ and the cross. holding and trusting to the ONE TRUE GOD alone.', '2020-10-20 14:22:48', 'Denied', NULL, '', '', NULL, NULL, 'Doesn\'t comply with the qualification: Credential is CW and Less than 10years in the ministry'),
(115, 3673, 'Bernabe Benito', 'Nazaria Colico', 'Judge Felisberto Gonzales', 'RTC BR 1 Isabela Basilan', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'SMC', '1984', 'Iligan City', '1986', 'HLBC Davao City', 'The calling started after the Lord showed me in a dream Joel 2:28 thereby fullfilling to pursue the ministry till date and currently pastoring Zambowood FC Zamboanga City', 'After graduation I was assigned as the resident pastor of Quiniput New Life FC Zamboanga City', 'Tictapul Foursquare Church\r\nNangka Foursquare Church', 'Tictapul FC Malagutay FC Sindangan FC Isabela FC\r\nNangka FC Jupiter FC       Buluan FC       \r\nGuilinan FC San Roque FC Jobel FC', 'NO ', 'yes', 'NO', 'ATP - 1987\r\nCW - 1988\r\nLM - 1989 onward', 'NO', 'NO', 'yes', 'yes', 'yes', 'yes', 'yes', 'By God\'s grace faithful and generous tithers of Zambowood Foursquare Church', 'yes', 'I believe that salvation is a free gift from God offered to everyone John 3:16 not of our works\r\nEphesians 2:8-9  cannot be earned but only receiving thru faith in the Lord Jesus Christ.', 'I believe n the Eternal God Head The Father- The King of the Universe, full of glory and majesty, send His only begotten Son to die for our sins- The Son Jesus Christ Who has always been with the Father\r\nWho died for our sins and lives again and sitted at the right hand of the Father to defend us.\r\nThe Holy Spirit always with the Father and the Son now with us  to guide us and help us.', 'Yes  our life is eternally secured in Jesus- Romans 8:1\r\nIf we commit sin applied 1 John 1:9', '2020-10-21 10:29:00', 'Accepted', '2020-10-23', 'October 27, 2020 1:59:am  ', 'Submitted', NULL, NULL, 'Please email a recommendation\r\nlink at aura6972@gmail.com to complete your application. '),
(116, 2196, 'Tolomeo Barba', 'Felisa Geronimo', 'Fr. Alfonso Grageda', 'Naga City, Camarines Sur', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'CMS', '1983', 'Angeles City', '1984', 'CCP Manila', 'My calling started in Paco Manila street children ministry till I was assign to handle freight forwarding branch in Zamboanga where the calling became so strong to be deeply involved in the ministry under GNT Foursquare Church with Rev. Domingo Calisang as the Zambasul District Supervisor and Senior Pastor.', 'Actively participating in evangelism crusade leadership seminar and reorganizing United Foursquare Men Ministry in each church under Zambasul District', 'Ayalare Foursquare Church\r\nZamboanga City', 'Tictapul FC  Lamitan FC\r\nJupiter FC    Malamawi FC\r\nIsabela FC    Lord of the Harvest FC', 'NO', 'yes', 'NO', 'CW-1993\r\nLM-2000', 'NO', 'None', 'yes', 'yes', 'yes', 'yes', 'yes', 'Thru its general funding emanating from Tithes and Offering and outside sources', 'yes', 'The only way to salvation is by accepting Jesus Christ as personal Savior Lord and King in full submission to His authority.', 'God the Father God the Son and God the Holy Spirit - Three persons in One God working in different offices but working as One.', 'Salvation is to be worked out with fear and trembling thus maintaining righteous living by God\'s grace.', '2020-10-20 14:30:09', 'Accepted', '2020-10-23', 'October 27, 2020 2:02:am  ', 'Submitted', NULL, NULL, 'Please email me a recommendation link at aura6972@gmail.com to complete your application.'),
