(163, 3807, 'Fajutag, Pepito Fajarit', 'Fetalvero, Amparo Fallar', 'Rev. Aser Lagan', 'Batangas City', '', '', '', '', '', '', '', '', '', 'BTh', '1980', 'Romblon', '1984', 'Romblon', 'The word of God was introduced by God\'s servant Rev. Lollie Gadon, I was mentored by my spiritual father Rev. Herminio Batoy, equipped in my studies at Foursquare Bible College after graduation from Bible school assigned in Pioneering work at Pinamalayan Or Mindoro,under the supervision of Rev.Joel and Rev.Shirley Garcia,i thank God for sustaining me with HIS grace and love the reason why im still in the ministry until now,Romans 11:29 GOD\'s gifts and HIS calling are irrevocable.', 'Pioneering at Pinamalayan Or Mindoro\r\nYouth Pastor at Batiano Foursquare Church\r\nPastor at Maliwanag Foursquare Church Mansalay Oriental Mindoro\r\nAcademic Dean ,Foursquare Layman Bible Institute Roxas Oriental Mindoro\r\nCE /Sunday School Division coordinator South Oriental Mindoro Division  that time', 'Newlife Foursquare Church,Pinamalayan Oriental Mindoro\r\nLift High the name of JESUS Foursquare Church\r\nCamp Vicente Lim Calamba City', 'The two churches that i pioneered above\r\n a help for other foursquare churches who do evangelization\r\nlike all the foursquare churches in our place of Simara Corcuera Romblon', ' NO. po', 'yes', 'YES,i am engaged to HOMEBASED ONLINE BUSINESS after doing all my responsibilities in the ministry ,tent making during my free time as part of my sustainability support to every mission work i am doing in the community,i strongly decided to be in this business bec it do not give me pressure in time and it do not affect my Pastoral and mission work  give me chance and previlege to reach out my business partners with Gods word and minister to them through prayer.PRAISE GOD', 'LM 1991-1997\r\n       2019 up to present', 'NO, po', 'NO,po', 'yes', 'yes', 'yes', 'yes', 'yes', 'Sustained by GOD by through HIS, grace and faithfulness\r\nmy nutritional feeding for less fortunate children,giftgiving for the senior citizen is sponsored by my sister in law,pastoral needs are supported by the church tithe giving,my husband and other tithe giver', 'yes', 'SALVATION  is totally an act of GOD by grace through FAITH IN CHRIST JESUS and not by good works  Ephesians 2;8,9', 'Believe that GOD is triune :  FATHER ,SON AND HOLY SPIRIT,The three are coexistent,coeternal,and equal in divine perfection.\r\nFOR THERE ARE THREE THAT BEAR RECORD IN HEAVEN,THE FATHER,THE WORD AND THE HOLY GHOST AND THESE THREE ARE ONE\'  1JOHN5;7', 'According to the foursquare creedal statement of faith we believe in the will power of man to backslide and apostasize and be lost, that results to the rejection of ETERNAL SECURITY. \r\nTHE BIBLE CLEARLY TEACHES that a TRUE BELIEVER cannot lose his /her salvation.1 john 5;11\r\nEPSSHESSIANS 4;30\r\n\r\n\r\n', 'April 1, 2021 10:29:am  ', 'Accepted', NULL, 'April 10, 2021 4:49:pm  ', 'Submitted', NULL, NULL, 'Recommended to be ordained by Rev. Jose Sanchez, SLD Supervisor'),
