(142, 2031, 'Isabelo Baluca', 'Maxima Palingcod', 'Jimmy Valde', 'Cebu City', 'N/A', 'N/A', '', '', '', '', '', '', '', 'SMC', '1985', 'Bohol', '1990', 'Tagbilaran Bohol', 'From my elementary time God already touch my heart a passion for the people.  Until my High School days still God convicted to go to bible school but I refused it for in my mind I finish my study and start to live with my dreams. When I was in college God slowly touch my heart to give time to pray for the sick people first with my sick friend. God used to bring her in Heaven by introducing Jesus in her life before she died. The passion in my heart always moving until I am in college. He showed m', 'I was in bible school days i always wanted to do evangelism my passion is for the lost souls. Even in my church sunday assignment. After graduation Pastor Rewel assigned me to the  place where there is no Foursquare church yet. What I did more evangelism saturate the whole city of Bogo, walking declaring every streets of salvation over people. Started bible study to those who accept the Lord and gathered them in one place for worship service. Until now by the grace of God the ministry is still a', '(God\'s Dwelling Place) Foursquare Gospel Church', '(God\'s Dwelling Place) Foursquare Gospel Church\r\nExtension church is not yet fix as of now the name\r\n', 'No', 'yes', 'No', '2014', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'Still growing and blessed', 'yes', 'I am save by my faith as accept Jesus Christ as my Lord and Savior( John 3:16 and John 1:12) and by His grace I have been saved as gift of God to me..washed by the blood of the lamb Jesus Christ. I believed Jesus died on the cross for the forgiveness  my sin that inherated  from the one brought sin in the world Adam.  As I confessed my sin He is faithful and just to forgive me. I believe the gift of salvation by God\'s grace and mercy freely offers to me.  I am not saves by my own but paid for by', '1 John 5:7 For there are three bear witness in heaven: the God Father, the God son and the God Holy Spirit; and these are one. (Trinity) 3 person in the eternal Godhead but only one God. Acting and proclaiming one God but itin different functions and in dispensation introducing Almighty God, The Sovereignty and Power.', 'John 6:47 Jesus says those who believe in me has everlasting life. So being I am child of God I have faith ang hope with assurance of everlasting life in heaven. That God give me the assurance of eternal life for my sin is already  paid through the death of Jesus my savior. My eternal security are I am child of God, I am heavenly citizen. I am sealed with the Holy Spirit to proved that I am in Him and He is in me,  by faith I have eternal life, I am one counted belongs to the family of God to li', 'October 22, 2020 7:39:am  ', 'Accepted', '2020-10-29', 'October 29, 2020 11:11:am  ', 'Submitted', NULL, NULL, 'for national processing'),
(123, 665, 'Domingo R. Calisang', 'Leah Permalan Documento', '', '', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'CMS', '2011', 'Zamboanga City', '2011', 'GNT Foursquare Church', 'I tried running away and kept ignoring God’s calling, I was supposed to work as a nurse with my sister abroad(USA), i thought I could totally run away from God’s calling, until I got tired. 2011 was the year that change everything, an encounter with God that change even the way I see life until now. It change my perspective and gave me a meaning and a purpose, before that I did not even know my purpose in life and it seems my life had no meaning. So Surrendered myself to God, answered the callin', 'Preaching every Tuesdays, Fridays and Sundays\r\nBible Studies every Wednesdays and Saturdays\r\nOutreach and Discipleship programs\r\nSummer Bible Booth Camp\r\nSpeaking Engagements and Invitations (Schools, groups, organizations, Church, Events and etc)\r\nCounselling and prayer\r\nMiracles and signs and wonders happening', 'N/A', 'None', 'N/A', 'yes', 'None', '2014-2015\r\n2015-2016\r\n2016-2017\r\n2017-2018\r\n2018-2019\r\n2019-2020', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Faithful Church members consistently giving their tithes and offering. \r\nSupporters and Donors who God touches their heart to give always right on time.', 'yes', 'There is only one way to be saved. That is through Jesus Christ.\r\nSalvation is only by grace through faith in Christ Jesus.', 'I do believe in 3 Persons 1 God. The Father, The Word(Son) and The Holy Ghost and these three(3) are one.', 'I do believe in eternal security when a person fully and with all humility accepts Jesus as Lord and surrendering to Him totally and believing that Christ is not only able but willing to save as long one has faith in Him through Grace.', '2020-10-20 14:54:32', 'Denied', NULL, '', '', NULL, NULL, 'Non-compliance: Credential is CW, No pastoral recommendation from the District & less than 10years in the ministry.'),
(124, 3667, 'Rev. Domingo R. Calisang', 'Rev. Leah D. Calisang', 'Ptrs. Domingo/Leah Calisang', 'GNT - Zamboanga City', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', '', '1978', 'Church', '1986', 'Youth Camp', 'Although there were lots of admonition about my calling by my parents, Missionaries, by Nanay Thompson, from a Pastor I\'ve met in Israel 2007. I just ignored all, went abroad with the Band. Dec. 2009 when we had a Gig in Baguio for Dep-Ed, there I just feel empty & lonely then I recall every words that were said. So I said, Lord, if it\'s You, just do Your will, yes! He did, then my outlook in life was changed to love & follow God\'s call. God moves in mysterious ways, glory to God!', 'I served as the youth Pastor and lead the Praise and Worship team at Green Pasture Church headed by Rev. Ricky Andajao. Did Radio ministry and Doing Praise and Worship and Preaching in some Churches, Foursquare and none Foursquare.', 'N/A', 'Good News Temple foursquare church, ICCF foursquare church, Korban foursquare church, Zambowood foursquare church, Tictapul foursquare church, Jupiter foursquare church, Guilinan foursquare church, Libertad foursquare church, Ipil foursquare church, Word for the World Christian Fellowship, Jesus reigns ministry, Zamboanga Pastors Association, Radio Ministry, SINGSpiration ministry (a family ministry-live streaming on FB)', 'N/A', '', 'business for additional  financial support for the family.', 'ATM- 2013\r\nCW - 2015', 'N/A', 'N/A', '', '', '', '', '', 'Thru the giving of tithes and offerings of church members and thru love gifts and help from supporters and friends.', '', 'Salvation can only be obtain through Jesus Christ our Lord, by confessing that He is the only begotten Son of God who died on the cross and rose again the 3rd day and His precious blood that was shed to redeemed us from all sin, wickedness, and unrighteousness. He is the Way the Truth and the Life no one comes to the Father but through Him.', 'I believe in God the Father, I believe in God the Son, I believe in God the Holy Spirit. There are three person but only One God, the creator of the Universe, eternal, holy, loving, all-powerful and deserve our praise.', 'He/She can only have eternal security if and only if he/she will remain faithful, righteousness, keeps his/her salvation by not forsake his/her confidence of faith in Christ and the cross. holding and trusting to the ONE TRUE GOD alone.', '2020-10-21 13:22:33', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
(125, 1062, 'Rolando S. Aboloc', 'Rosalina Belmes', 'Rev. Sinfroso Pun an', 'Pagadian City', 'N/A', 'N/A', '', '', '', 'N/A', '', '', '', 'BTh', '1995', 'Zamboanga City', '1997', 'Ebenezer, Zamboanga City', 'My mother was a Pastor and I am her eldest son. I began to feel God\'s inward call to ministry when I joined Youth Camp. After my College i decided to enrol at HLBC because l know God already called me to serve Him.', 'I served as associate Pastor for one year at Ayalare Foursquare church where my mother handle and after that became Head Pastor until now. I did all ministerial activities of a Pastor.', 'Church in Samal Foursquare', 'Church in Samal Foursquare, Checkered farm Foursquare, Tibungol Foursquare, Tictapul Foursquare, Jupiter Foursqaure, Ayalare Foursquare', 'No', 'yes', 'No', 'LM - 2013', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'By church members', 'yes', 'First, we should acknowledge that we are sinner and repent our sins. Believe Jesus Christ and accept Him as Lord and Savior.', 'There is One God Who eternally exist as Three distinct persons The Father, Son and Holy Spirit.', 'Is a result of God keeping us, not us maintaining our salvation. It should be purchased by CHRIST, Promised by the Father, and sealed by The Holy Spirit.', '2020-10-20 18:22:27', 'Denied', NULL, '', '', NULL, NULL, 'Less than 10years in the ministry'),
(162, 508, 'HERMINIO V. SALAZAR', 'BELLA M. MALIWANAG', 'REV. NOEL D. GACA', 'TEMPLE OF PRAISE, TERESITA, MANSALAY, ORIENTAL MINDORO', 'NOT APPLICABLE', '', '', '', '', '', '', '', '', '', '1988', 'BINANGONAN, RIZAL', '1995', 'TEMPLE OF PRAISE, MANSALAY', 'I was a fresh graduate from college when I decided to take on a 5 day fasting to be sure of the plans I wanted to pursue. I was praying for the right job and a successful career. After praying and fasting, I was answered by the Lord telling me to go to Odiongan and study at OFBC. I was afraid at first, but God\'s calling was more pressing than my fears.', 'My first ministry was as an Associate Pastor at Temple Of Praise under the leadership of Rev. Noel Gaca. It lasted 3 months and then I handled Alpha Foursquare Church and also became the ORMD District Secretary. My ministry as the head Pastor lasted a year and then on 2007 when I got married, I became the Pastor\'s wife, taking up support ministry for my husband.', 'None', 'Alpha Foursquare Gospel Church\r\nPraise Foursquare Gospel Church', 'No', 'yes', 'Government Employee at present as Local Assessment Operations Officer II of the Assessor\'s Office', 'LM - 2006 to present', 'No', 'None', 'yes', 'yes', 'yes', 'yes', 'yes', 'Through the faithfulness of the church members', 'yes', '- repent our sins - we need to ask forgiveness from our sin in order for us to be forgiven - John 1:9; we need to repent in order for us to receive salvation.\r\n- acceptance of Jesus Christ as our personal Lord and Savior - John 3:16', 'There is one God, Creator of the universe, eternal, holy, loving, all powerful and deserving of our praise and thanks; and that in the unity of the Godhead, there are three equal and divine; the Father, the Son, and the Holy Spirit.', 'We are saved because of the grace of God (Eph 2:8). We were atoned by His blood to be cleansed. We were commanded by Jesus to refrain from sinning. In John 1:9 we were told that the Lord is faithful and just to forgive our sins, meaning He knows that we are weak. Nevertheless, in Revelation the Lord said that not everyone that calls Him Lord are worthy. Salvation is there but we need to safeguard our relationship with the Lord that is why we still need to live not according to the ways of the wo', 'March 31, 2021 1:42:pm  ', 'Accepted', NULL, 'April 8, 2021 11:23:am  ', 'Submitted', NULL, NULL, 'Congratulations!\r\nYou passed the interview.'),
(129, 673, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2007', 'Abu Dhabi', '2014', 'ICCF', 'I\'ve been serving the Lord Jesus Christ in the music ministry for quite some years when the burden shifted from playing instruments to Preaching the Gospel and for the caring of souls. indeed it was being confirmed both by visions and Scriptures until finally ICCF Foursquare Gospel Church came into existence of which your servant now is the Senior Pastor installed by our Zambasul District Supervisor Rev. Ricky C. Andajao.', 'by the time i graduated from my CMS in the Halls of Life Bible College Zamboanga City extension, i was at that time doing Jail ministry and at the same time appointed to be the UFM Zambasul District President until the Pioneering of ICCF foursquare Gospel Church.', 'ICCF (Immanuel City Center Fellowship) Foursquare Gospel Church.', 'only ICCF for now.', 'NO.', 'yes', 'NO.', '2013-2015 ATP\r\n2016-2020 CW', 'NO>', 'NO.', 'yes', 'yes', 'yes', 'yes', 'yes', 'ICCF Foursquare Gospel Church is being supported and Sustained through the Tithes, Offering and pledges both by members and supporters.', 'yes', 'through and by Faith only in Jesus Christ.', 'I Believe in the Triune God.  One God in three divine Person- God the Father, God the Son and God the Holy Spirit.', 'I believe in once save is always save if we stay save..  (Romans 11:22).', 'October 16, 2020 8:01:pm  ', 'Returned', NULL, '', '', NULL, NULL, 'duplicate entry'),
(130, 1008, 'Elias Balbas', 'Semprosa Dalag Batobato', 'Rodelio Jabien', 'Baguio City', '', '', '', '', '', '', '', '', '', '', '1997', 'Mangatarem, Pangasinan', '1989', 'San Jose Del Monte, Bulacan', 'My call to ministry makes a long process because of my stubborn heart. The circumstances that strikes me heavily was that when my transport service business was bankrupt and left me several debts in 2005, while I am so depressed I prayed to God asking what He wants me to do. Several nights passed praying, God showed me a vision a rice field ready to harvest and found myself standing with complete military uniform carrying rice stalks full of grain. The thing bothered me so much, so I seek the ad', 'I am an undergraduate of FBC.', 'Jesus Christ is the Answer Foursquare Church', 'Buhay Para Kay Hesus', 'No', 'yes', 'None', 'CW-2008\r\nLM-2018', 'Yes, I was ordained pastor year 1998 in an independent church named Buhay Para Kay Jesus by Bishop Butch Villanueva.', 'None', 'yes', 'yes', 'yes', 'yes', 'yes', 'I have a pension from being a retired Army ;and also by the tithes and offering.', 'yes', 'Jesus Christ the only way to Salvation.  Salvation is free gift from God. Salvation is through faith alone. \r\nIn Ephesians 2:8, \"For it is by grace you have been saved through faith - and this not from yourselves, it is the gift of God\". \r\nIn Acts 4:12, \"Salvation is found in no one else for there is no other name under heaven given to men by which we must be saved.\"\r\nIn Romans 10:9-10, \"If you declare with your mouth, “Jesus is Lord,” and believe in your heart that God raised him from the dead,', 'The Godhead in three person with distinct works and function. God the Father, God the Son and God the Holy Spirit  co-exist in the creation and in the beginning. \r\nIn Genesis 1:1-2, \"In the beginning God created the heaven and the earth. Now the earth was formless and empty, darkness was over the surface of the deep, and the Spirit of God was hovering over the waters\". In Genesis 1:26, Then God said, \"Let us make man in our image, in or likeness, and them rule over the fish of the sea and the bi', 'Eternal security is a promise to us by God who believes in Him. \r\nIn John 3:16, \"For God so loved the world that he gave his one and only Son, that whoever believes in him shall not perish but have eternal life.\".\r\nIn Romans 6:23, \"For the wages of sin is death, but the gift of God is eternal life in[a] Christ Jesus our Lord.\'\r\nIn John 6:47, \"Very truly I tell you, the one who believes has eternal life.\"', 'October 16, 2020 8:08:pm  ', 'Accepted', '2020-10-21', 'October 21, 2020 12:23:pm  ', 'Submitted', NULL, NULL, 'accepted'),
(131, 1523, 'Lopez, Dionie C.', 'Salloman, Gloria Bersamina', 'Rev. Delfin Corona', 'San Fernando, Cebu', '', '', '', '', '', '', '', '', '', 'SMC', '1999', 'Almeria, Biliran', '1999', 'Almeria, Biliran', 'God\'s dealing with me is peculiar in that he uses circumstances to lead me into Pastoral ministry. It started with my father\'s first incident of cardiac arrest in the summer of 2005 that I decided to hold in abeyance post graduate career endeavors and instead take a full time job and in the meantime enroll full time with CFBC to complete unfinished SMC course. Being the longest tenured student, I was appointed by then Director (Rev. Rewel Buctuan) to be the Student Body President who then formul', 'Please refer to Box A.', 'Talisay Foursquare Gospel Church', 'JYIF Alumnos Foursquare Gospel Church (Now Talisay Foursquare Gospel Church)', 'No.', 'no', 'Yes. To me, ministry should not be treated as occupation. Thus, I derived income from my employment and other secular engagements to financially support family and ministry. ', 'LM-2006', 'No. ', 'No. ', 'yes', 'yes', 'yes', 'yes', 'yes', 'Local Church Tithes and Offering.', 'yes', 'It is absolutely by Grace through faith on the finished work of Christ (Eph. 2:8,9)', 'There is one God in three Persons-the Father, Son and the Holy Spirit. Co-eternal, co-equal, one in purpose and having same attributes. ', 'Whoever believes in Him shall not perish but have eternal life. It is safe to say that Eternal life is a promise of security (and is never eternal insecurity) provided that the person is genuinely saved of course. To contend otherwise would defeat Christ\'s sacrifice which is ones and for all, attribute \"works\" in relation to salvation, much less the infallibility of God in the exercise of His sovereign choice. (Eph. 1:4-5)', 'October 17, 2020 11:36:am  ', 'Accepted', '2020-10-29', 'October 29, 2020 11:12:am  ', 'Submitted', NULL, NULL, 'for national processing'),
(134, 3679, 'Henry D. Orque', 'Esmeralda Abani Torres', 'Rev. Abraham Yuwono', 'Manado City, Indonesia', '', '', '', '', '', '', '', '', '', 'BTh', '2003', 'Isabela Basilan', '17', 'Cebu', 'I am Eleazar Orque, I grew up in Isabela City Basilan. I was a Pastor’s kid and I grew up Serving and helping the ministry as a musician of my father’s church in Water of Life Malamawi Island Isabela City Basilan. I used to think that having a part every church’s Sunday service as a musician is already enough to pleases the Lord and nothing more beyond than that. I still don’t know my life’s purpose back then, until last 2003 my father brought me to joined the Foursquare National Convention held', 'I was the associate pastor at Water of Life Foursquare Church which my father Rev. Henry Orque was the Senior pastor. I also helped overlooking and pastoring the congregation in Temple of Praise Foursquare Church in Isabela City Basilan. I also serve the Lord in a pioneering ministry in Sibugay Zamboanga del Sur', 'Diplahan Foursquare Gospel Church', 'Ayala Foursquare Church, Binaton Foursquare Church, Temple of Praise Foursquare Church, Water of Life Foursquare Church, Pagadian City Foursquare Church.', 'Yes, I pursued my calling as a Missionary together with my wife serving the Lord in East and Central Indonesia.', '', 'No, I am officially serving the Lord full time and my wife is working as a Compassion Staff in Indonesia. ', 'ATP - 2009\r\nLM - 2013', 'No. The reason is, I am a bond servant of God placed under in the umbrella of Foursquare Gospel as a minister committed to this denomination alone. ', 'I don\'t have any type of credential or pending application with any other denomination because my allegiance as a minister of God is in the CFGP only. ', 'yes', 'yes', 'yes', 'yes', 'yes', 'The ministry that I currently doing right now is under supported by the CFGP Missions and my wife is a Compassion Staff here in Indonesia that helps supports the ministry. ', 'yes', 'The Way of Salvation is through Jesus Christ alone the way to eternal life. He is the only way. For Jesus says in John 14:6, “I am the way and the truth and the life. No one comes to the Father except through me\". Whoever believes in the Son has eternal life... John 3:36a.\r\n\r\n', 'The hardest thing about the Trinity is that there is no way to perfectly and completely understand it. But I believe that God is a triune: that the Father is God, that Jesus is God, and that the Holy Spirit is God. Paul\'s Epistles can also help us to understand the Trinity in  2 Corinthians 13:14  “May the grace of the Lord Jesus Christ, and the love of God, and the fellowship of the Holy Spirit be with you all.', 'The Bible says, in 1 John 4:4 “for he who is in you is greater than he who is in the world.” And in Romans 8:31-39 that Nothing can separate us from the love of God. I am persuaded that the security of our salvation on the fact that God’s power can protect us from all forms of attack on our salvation. This is not to encouraged for the believers of Jesus Christ to backslide and return to old sin and still believed they are saved. For I believed that we are responsible of what we are doing even we', 'October 17, 2020 9:10:pm  ', 'Denied', NULL, '', '', NULL, NULL, 'less than 10years in the ministry and lack of recommendation'),
(135, 1062, 'Rolando S. Aboloc', 'Rosalina Belmes', 'Rev. Sinfroso Pun an', 'Pagadian City', '', '', '', '', '', '', '', '', '', 'BTh', '1995', 'Zamboanga City', '1997', 'Ebenezer, Zamboanga City', 'My mother was a Pastor and I am her eldest son. I began to feel God\'s inward call to ministry when I joined Youth Camp. After my College i decided to enrol at HLBC because l know God already called me to serve Him.', 'I served as associate Pastor for one year at Ayalare Foursquare church where my mother handle and after that became Head Pastor until now. I did all ministerial activities of a Pastor.', 'Church in Samal Foursquare', 'Checkered farm Foursquare Gospel Church, Tibungol Foursquare Gospel Church, jupiter Foursquare Gospel Church, and Ayalare Foursquare Gospel Church.', 'No', 'yes', 'No', 'LM - 2013', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'By the church', 'yes', 'First, we should acknowledge that we are sinner and repent our sins. Believe Jesus Christ and accept Him as Lord and Savior.', 'There is One God Who eternally exist as Three distinct persons The Father, Son and Holy Spirit.', 'Is a result of God keeping us, not us maintaining our salvation. It should be purchased by CHRIST, Promised by the Father, and sealed by The Holy Spirit.', 'October 19, 2020 6:37:am  ', 'Denied', NULL, '', '', NULL, NULL, 'less than 10 years'),
(136, 2196, 'Tolomeo Barba', 'Felisa Geronimo', 'Fr. A;fonso Gregeda', 'Naga City, Camarines Sur', 'NA', 'NA', '', '', '', 'NA', '', '', '', 'CMS', '1983', 'Angeles City', '1984', 'CCP Manila', 'My call started in Paco Manila street children ministry till I was assign to handle forwarding branch in Zamboanga where the calling became so strong under GNT Foursquare Church with Rev. Domingo Calisang as the Zambasul District Supervisor and Senior Pastor.', 'Deeply involved in Evangelism and Leadership program throughout Zambasul District.  ', 'Ayalare Foursquare Gospel from 2000-2005 as I was assigned in District level activities', 'Isabela FGC        Jupiter FGC         Pagadian FGC\r\nMalamawi FGC   Ipil FGC\r\nTictapul FGC       Sindangan FGC', 'NO', 'yes', 'NO', 'CW- 1993\r\nLM-  2000 till date', 'NO', 'NO', 'yes', 'yes', 'yes', 'yes', 'yes', 'General fund from Tithes and Offering and outside supporters ', 'yes', 'Salvation is thru accepting Jesus as personal Lord Savior and King of my life just as John 14:6 says\r\n\" I am the way the truth and the life, no one comes to the Father except by me\"', 'The God the Father , God The Son, and God The Holy Spirit - all existing even before and during the creation working together as One God in different offices.', 'Eternal Security is individual working out each respective person after receiving salvation with fear and trembling maintaining righteous living by God\'s grace till Jesus comes. ', 'October 19, 2020 9:53:am  ', 'Returned', NULL, '', '', NULL, NULL, 'Duplicate entry'),
(137, 665, 'Domingo Resurreccion Calisang', 'Leah Permalan Documento', '', '', '', '', '', '', '', '', '', '', '', 'CMS', '2010', 'GNT Church', '2011', 'GNT Church', '2011 was the year that I committed myself to God, I tried running away and ignored the call of God, but having an encounter with our Lord totally change everything, during that time I was tired of running away, suppressing and ignoring God’s calling. I was fed up with my messed up nonsense life (nonsense because my life has no sense at all, it had no meaning). But when I answered the call and surrendered myself to God, everything made sense and my life had a purpose. God is indeed so good.', 'Speaking engagements(school, Churches, organizations, virtually and etc), Bible Studies, Anniversaries and Thanksgivings, Discipleship programs, Summer Bible Booth Camp, Outreach programs, Overnight prayers, Teaching youth on how to play musical instruments and etc.', 'None', 'FBA Church\r\nTictapul Foursquare Church\r\nJupiter Foursquare Church\r\nLitawan Foursquare Church\r\nGumuyong Foursquare Church\r\nQuiniput Foursquare Church\r\nSolid Rock Foursquare Church\r\nGNT Foursquare Church', 'None', 'yes', 'None', 'ATP - 2014-2015\r\nCW - 2015-2016\r\nCW - 2017-2018\r\nCW - 2018-2019\r\nCW - 2019-2020', 'None', 'None', 'yes', 'yes', 'yes', 'yes', 'yes', 'Faithful Church Members who consistently and faithfully give their tithes and offerings, donors and supporters who are always right on time and above all our great provider who provides in an amazing way our Great and mighty God.', 'yes', 'Salvation is by grace through faith in Christ alone. That what Christ hs done on calvary is more than enough and the only thing and way that can saved.', '3 Persons (The Father, The Word[Son] and The Holy Ghost. And these 3 are 1. 3 persons 1 God.', 'I believed in eternal security When accepting Jesus Christ with whole heart as being Lord and Savior of one’s life with total surrender to His will, a person is eternally secured. ', 'October 19, 2020 6:01:am  ', 'Returned', NULL, '', '', NULL, NULL, 'duplicate'),
(138, 1010, 'Edison Maquiñana,', 'Juliet Tongol', '', '', '', 'Roy Latuga', 'yes', 'yes', 'yes', '', 'no', 'yes', '', 'BTh', '2007', 'Capitol City Foursquare Church', '2008', 'Jala-Jala Rizal', 'It was 2007, I was from a retreat when Pastora Kaye asked me if I like to study in Bible School, I said I know I\'m not capable of studying in Bible School. Then she said if there will be a sponsor it is the will of God. Little did Pastora Kaye know that night I was praying so hard that if she will call early next day, it is the sign that God is really calling me despite that I\'m not capable in all aspects.  Praise be to God, His answer was a big Yes. ', 'Before graduation, I was assigned to be the senior of Living Streams Foursquare Church year 2011.  I was assigned as Division Secretary and Youth Coordinator while pastoring LSFC.  It was hard at first but praise be to God that despite of all the challenges in the ministry, God keep me going in serving him until now. ', 'Living Streams Foursquare Church', 'Life Streams Foursquare Church', 'No.', 'yes', 'No. ', 'CW-2011\r\nLM-2012', 'No.', 'No.', 'yes', 'yes', 'yes', 'yes', 'yes', 'My ministry in LSFC is supported by tithes and offerings. IOur long time ministry (feeding ministry) is supported of by our regular sponsors through donations and pledges. ', 'yes', 'I do believe that our Lord Jesus Christ is the only way for Salvation. That I have save by Grace through faith in Him as my Lord and Savior as I believe in John 3:16 and Romans 6:23.', 'I strongly believe that there is one God in unity of the Godhead, God the Father who is my Abba which I can run to in every seasons of my life, the creator of Universe, God the Son: Jesus Christ, my Redeemer, and the Holy Spirit, my guide and my comforter. All of them are co-equal, co-eternal and majestic in power. ', 'I believe that we are all saved by Grace through Christ our Lord. That our salvation is a free gift from God as what Ephesians 2:8 says. That in Him we are assured of our future even after death. ', 'October 19, 2020 6:52:pm  ', 'Accepted', '2020-10-20', 'October 21, 2020 12:14:pm  ', 'Submitted', NULL, NULL, 'Accepted'),
