(157, 3736, 'Isaias A. Buctuan', 'Nerbita L. Dorai', 'Hermis Guiritan', 'Lantoy, Tara, Mabinay, Negros Oriental', '', '', '', '', '', '', '', '', '', '', '1975', 'Pob. Norte Batuan Bohol', '1978', 'Pob. Norte Batuan Bohol', 'It is my great desire to work and serve for the Lord. ', 'I had two months internship in Leyte. Then I experienced being an assistant pastor for five months in Negros Oriental. And in 1983,I started ministering as a pastor in Lantoy, Tara Negros Oriental which lasted for 7 years. After getting married, I returned to my home province and was assigned in Lagtangan Sevilla Bohol for 8 years . Then ,I started a pioneering church in Calinginan Sevilla Bohol and my ministry there lasted for 12 years. Finally, I started to pioneer another church in Guinub an ', 'Calinginan Foursquare Gospel Church and Guinub-an Foursquare Gospel Church', 'Lantoy Foursquare Gospel Church, Lagtangan Foursquare Gospel Church, Calinginan Foursquare Gospel Church and Guinub an Foursquare Gospel Church', 'No.', 'yes', 'no', '1983-2021\r\n', 'no', 'no', 'yes', 'yes', 'yes', 'yes', 'yes', 'A percentage of church income and any kinds from the members.', 'yes', 'Fo by grace we are save through faith . ', ' There is only one God but is represented by three , God the Father, the Son and the Holy Spirit.', 'There is eternal security after we receive Jesus Christ as our Lord and Savior, but as a result of our salvation, good deeds follow and we should live according to the will of God.', 'February 12, 2021 8:55:am  ', 'Accepted', NULL, 'February 18, 2021 10:30:am  ', 'Submitted', NULL, NULL, '30 years in service and above 60 years old'),
(141, 889, 'Emeterio A. Hamor', 'Teresita L. Braxton ', 'Rev. Rodolfo \"Starsky\" Carolino', 'Marikina Foursquare Gospel Church', 'N/A', 'N/A', '', '', '', '', '', '', '1992-04', 'BTh', '1985', 'Christ To The Orient', '1985', 'Christ To The Orient Mission, Inc. ', 'When I was totally submitted to Him and be in control of my decisions. He has given me a new value, new idea, talents, interests, and desires. And I\'ve been able to help, care, and bless other people in the past. Thank God for how he has created me (Jer 29:11; Ps1:3; 23:6; Jos1:8) and ask Him to reveal more about how He would like me to contribute to His Kingdom. So, my availability concerning to the ministry as a part of my highest calling.', 'I dedicated myself to which I have been called under of Urban Church Planting Project (UCPP) since 2004 and I went through a length of training process that I will refer as a Foursquare Bible College (FBC) student. Presently, I am finished my schooling this year 2020 as Bachelor in Theology (BTh), and taking up an Instructor at Leadership Training International (LTI) with a partnership of IShepherd Institute (ISI) as a compliment and extension of my learning, just to set aside my time scholarly ', 'Balubad Foursquare Gospel Church\r\nBalubad Foursquare Gospel Church (new) ', 'Balubad Foursquare Gospel Church\r\nGreenheights Foursquare Gospel Church (new) \r\n', 'N/A', 'yes', 'N/A', '2004 - 2020', 'N/A', 'N/A', 'yes', 'yes', 'yes', 'yes', 'yes', 'Supported by my own family, in prayer, encouragement, and by His presence. ', 'yes', 'Salvation is extremely important to understand correctly. True Salvation is that which is provided by God Himself through the sacrificial death of His Son Jesus Christ. There is no other way that a man can be saved from eternal condemnation and to eternal life (Acts 4:12).', 'There is only one God, but in the unity of the God head there are three eternal and coequal persons, the same substance but distinct in subsistence. Proof in O. T. intimations - does not reveal the trinity but it allows for the later revelation of it. Passages which use the plural word Elohim and plural pronouns referring to God (Gen1:1,26; Isa 6:8).\r\nIn the N.T. there is clear revelation that the Father, Son, and Spirit are God, this a triunity or trinity, the Father is God (John 6:27, Epb 4:6)', 'In Heb 6:4-6. If this teaches that one can lose his salvation, it also teaches that one can never be saved a second time. Salvation is conditioned solely on faith in Jesus Christ (John 1:12; Acts 16:31). The proof of security rests on a proper concept of what God actually does when He saves a soul. His word guarantees that nothing (including ourselves) can separate us from Christ (Rom 8:28-29). In order to lose one\'s salvation of these work of God would have to be undone, and the Bible nowhere e', 'October 21, 2020 10:17:pm  ', 'Accepted', NULL, 'December 14, 2020 9:56:am  ', 'Submitted', NULL, NULL, 'Ptra K will personally give remarks'),
