(151, 1167, 'REYNOSO BERMEJOFESALBON', 'JOSEPHINE FAMINIAL BANTANG', 'REV. ABRILITO F. ESCARILLA', 'BANGON  FOURSQUARE CHURCH', '', '', '', '', '', '', '', '', '', 'BTh', '1989', 'BANGON', '1999', 'ROMBLON,ROMBLON', 'SINCE HIGH SCHOOL, I ALREADY FELT THE CALL OF GOD IN MY LIFE TO SERVE HIM IN FULL-TIME MINISTRY.  AFTER GRADUATION FROM HIGH SCHOOL, AT THE YOUTH CAMP, I COMMITTED MY LIFE TO FOLLOW THE LORD\'S LEADING AND I ENROLLED IN BIBLE SCHOOL. AFTER GRADUATION, I WAS ASSIGNED IN IPIL FOURSQUARE CHURCH. ', 'AFTER  GRADUATION I AM  ASSIGNED AT IPIL  FOURSQUARE  FOR  6  MONTHS, AND THEN I GOT MARRIED.  AFTER MARRIED WE ASSIGNED  A T C ANDUYONG  FOURSQUARE  FOR  1 MONTH AND MOVED  TO LI-O, ROMBLON, ROMBLON, WHILE PASTORING  MY HUSBAND HAS OUTREACH  MY FIRST PASTORATE WAS IN IPIL AND THEN IN  AGBALUTO. WITHIN  3 YEARS WE HAVE PASTORED 2  LOCAL  CHURCHES AND TRANSFERRED  AGAIN TO  SAN FERNANDO  FOURSQUARE AFTER  3  YEARS  WE WERE ASSIGNED  AGAIN  TO  BINONGAAN FOURSQUARE  FOR  1 YEAR  AND 4 MONTHS, THEN', 'LI-O FOURSQUARE\r\nAGBALUTO  FOURSQUARE', 'AGBALUTO  FOURSQUARE', 'NO', 'yes', 'NO', 'LM-FROM 1997 UP TO THE PRESENT', 'NO', 'NO', 'yes', 'yes', 'yes', 'yes', 'yes', 'BY  FAITH AND THROUGH CHRUCH ALLOWANCE', 'yes', 'SALVATION  THROUGH  GRACE NOT BY  WORKS;\r\nBY FAITH ACCEPT JESUS CHRIST AS LORD AND SAVIOR.', 'I BELIEVE IN THE TRINITY:\r\n GOD  THE FATHER\r\nGOD  THE SON\r\nGOD  THE HOLY SPIRIT', 'BECAUSE I RECEIVED  JESUS CHRIST AS MY LORD AND  SAVIOR I HAVE  SALVATION  AND \r\n AS LONG AS  I LIVE I WILL  SERVE THE LORD. I BELIEVE I AM ETERNALLY SECURED BECAUSE OF THE FINISHED WORK OF JESUS ON THE CROSS FOR US.', 'November 9, 2020 1:32:pm  ', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
