(153, 1151, 'Avelino Gabutero Gado', 'Merlyn Fetalver Faa', 'Ding Galisanao', 'Alcantara, Romblon', '', '', '', '', '', '', '', '', '', 'BTh', '1995', 'Batiano Foursquare Church', '1997', 'OFBC', 'I was already studying at secular in college but my heart is not happy and not satisfied because maybe one of my burden is to serve God and response to God\'s call. I finished my one year study in secular and after that I proceed my study to Bible School and there I found my happiness and completeness of my soul. I have a burden in my heart to serve people through sharing his word. ', 'After my graduation in OFBC, I held a church at Sta. Fe Tabugon. One year after and pursue again my study in BTH at FBC Quezon city. Then I assist at Olongapo Zambales in San Narciso for a year. I came back to my hometown to minister here in Romblon from 2006 until present. I am holding now Mountain of Life Foursquare Gospel Church Sitio Bailan, Rizal, Odiongan, Romblon.', 'Tabugon Foursquare Gospel Church', 'Mountain Of Life Foursquare Gospel Church.', 'No', 'yes', 'Yes, I am a Deped Teacher at present to support the needs of my family at the same time to help financially in my ministry.', '1995', 'None', 'None', 'yes', 'yes', 'yes', 'yes', 'yes', 'Church income', 'yes', 'Once you accept Jesus Christ as personal Savior you will be saved.', 'I believe in a Triune, God. God the Father, God the Son, God the Holy Spirit.', 'Yes', 'November 9, 2020 2:32:pm  ', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
(154, 1192, 'JAEMETO DELA AUSTRIA', 'ESTRELLA FABELLORE', 'Rev. Celso Selodio', 'Odiongan Foursquare Church', '', '', '', '', '', '', '', '', '', '', '1989', 'ALABANG, MUNTINLUPA', '1989', 'WORD FOR THE WORLD', 'I sensed my calling when  received a dream from the Lord when I attended the youth camp of Foursquare Church in Tumingad, Odiongan, Romblon. Since then, I desire to be in the ministry.', 'After I graduated from Bible School, I was involved in Christian School in Odiongan Foursquare Church, then I received my ministry as a pioneering pastor in Canlabha, Libertad, Odiongan, Romblon.', 'Canlabha Foursquare Gospel Church', 'Canlabha Foursquare Gospel Church', 'No.', 'no', 'Yes,to support my family and church ministry', '', 'No.', 'No.', 'yes', 'yes', 'yes', 'yes', 'yes', 'Through church income.', 'yes', 'Salvation is the gift of God through grace and by faith we are saved.', 'I believed in Triune God. God the Father, God the Son, God the Holy Spirit.', 'Yes', 'November 9, 2020 3:21:pm  ', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
(155, 1168, 'BERTIMIO GREGORIO TEÑOSO', 'ROFINA AMAR  GERVACIO', 'REV. ABRILITO F. ESCARILLA', 'BANGON  FOURSQUARE CHURCH', '', '', '', '', '', '', '', '', '', 'SMC', '1989', 'MAKATI', '1990', 'ODIONGAN', 'DURING CAMPING,I  A FELT CALLED  BY GOD THROUGH HIS  WORD. BUT ONLY AFTER 2 YEARS, IT WAS WHEN I ENROLLED IN BIBLE SCHOOL. I FOLLOWED HIS CALL AND UNTIL NOW I SERVE HIM TOGETHER WITH MY FAMILY.', 'I WAS A STUDENT PASTOR IN CANDUYONG, THEN AFTER  GRADUATION  IWEHANDLED  THE LOCAL  CHURCH IN LI-O AND CIRCUIT IMPINGAN, THEN PIONEERED AGBALOTO. AFTER 3 YEARS IN ROMBLON ISLAND, SAN FERNANDO, SIBUYAN FOR 3 YEARS, THEN TRANSFERRED BY THE DISTRICT BINUNGAAN, SAN AGUSTIN FOR 1 YEAR AND 4 MONTHS. THEN TRANSFERRED TO HINAG-OMAN AND NOW WE ARE 15 YEARS THERE. ', 'LI-O FOURSQUARE', 'AGBALUTO FOURSQUARE', 'NO', 'yes', 'NO', 'LM-1998', 'NO', 'NO', 'yes', 'yes', 'yes', 'yes', 'yes', 'BY  FAITH  AND THROUGH  THE SUPPORT OF LOCAL  CHURCH', 'yes', 'WE ARE  SAVED  THROUGH  GRACE BY  FAITH IN  CHRIST  JESUS AS WE RECEIVE HIM AS LORD AND SAVIOR.', 'WE BELIEVE THE THREE  PERSON IN ONE GODHEAD: THE FATHER, SON AND HOLY SPIRIT', 'WE  ARE SECURED  IN GOD  HANDS  BECAUSE OF WHAT JESUS DID ON THE CROSS FOR US.', 'November 9, 2020 4:26:pm  ', 'Submitted', NULL, '', NULL, NULL, NULL, 'For District Review'),
(158, 451, 'WELFREDO CAPILLO', 'PERLINA MACHADO', 'REV. JOEL GARCIA', 'LIBERTY FOURSQUARE CHURCH', '', '', '', '', '', '', '', '', '', '', '1972', 'LIBERTY FOURSQUARE CHURCH', '1980', 'LIBERTY FOURSQUARE CHURCH', 'Being a member of Liberty Foursquare Church, I was discipled by Pastor Felix Gusi Jr. during my youth. After my marriage, I was assigned in Waygan, Mansalay, Or. Mindoro as pioneering worker for almost 2 years. Then I studied in Layman Bible Institute in Roxas and was assigned to to different pioneering works, except Cambunang Foursquare Church.', 'Being a member of Liberty Foursquare Church, I was discipled by Pastor Felix Gusi Jr. during my youth. After my marriage, I was assigned in Waygan, Mansalay, Or. Mindoro as pioneering worker for almost 2 years. Then I studied in Layman Bible Institute in Roxas and was assigned to to different pioneering works, except Cambunang Foursquare Church.', 'Before graduating in Extension Bible School, I have already ministered in different pioneering church as stated in the list of churches; Libtong Foursquare Church, Panamin Foursquare Church, Cabugao Foursquare Church, Lambok Foursquare Church, Life Stream Foursquare Church.', '', 'No', 'yes', 'No', 'ATP - 1991-1994\r\nCW - 1995-1996\r\nLM - 1997 to present', 'No', 'No', 'yes', 'yes', 'yes', 'yes', 'yes', 'Supported by the church members and family.', 'yes', 'Mark 16:16   Faith and Grace', 'God the Father\r\nGod the Son\r\nGod the Holy Spirit\r\nMatthew 28:19, John 14:26;15:26', 'John 17:12 conditional\r\nMathew 24:13 Faithful to the end', 'March 31, 2021 11:04:am  ', 'Accepted', NULL, 'April 8, 2021 11:24:am  ', 'Submitted', NULL, NULL, 'Congratulations!\r\nYou passed the interview.'),
(159, 497, 'PORFERIO C. GURO SR.', 'ROSELA M. CAPILLO', 'REV. VICENTE CAPILLO', 'MAMBARAO, STO. DOMINGO, N. ECIJA', 'NOT APPLICABLE', '', '', '', '', '', '', '', '', '', '1975', 'LIBERTY FOURSQUARE CHURCH', '1978', 'LIBERTY FOURSQUARE CHURCH', 'As Pastor\'s Kid, I lived as a normal child with naughtiness and disobedience. Until one day I suffered undiagnosed illness for almost 2 months. My mother who was a widow had just live by faith that God is the only great physician that will heal my sickness. When I was almost dying in my illness, I saw a vision, an angel appeared to me holding book of life. He searched my name but it was not written there. I cried and asked forgiveness to give another chance. I promised to God to follow the foots', 'As Pastor\'s Kid, I lived as a normal child with naughtiness and disobedience. Until one day I suffered undiagnosed illness for almost 2 months. My mother who was a widow had just live by faith that God is the only great physician that will heal my sickness. When I was almost dying in my illness, I saw a vision, an angel appeared to me holding book of life. He searched my name but it was not written there. I cried and asked forgiveness to give another chance. I promised to God to follow the foots', 'As soon as I totally healed by the power of the Holy Spirit, my senior Pastor started to mentor me. He encouraged me to enroll in Phil. Outreach Bible Institute. After a year I was assigned to minister in Pola as Pastor. Then proceed to Mamburao Foursquare Church. Gift of healing in prayer, music ministry and evangelism were my ministry after graduation. My senior Pastor always assigned me in evangelistic crusade. ', 'Balatasan Foursquare Church\r\nMarinduque Churches\r\nCoro-coro Foursquare Church\r\nBaldefuente Assembly of God', 'No', 'yes', 'No', 'ATP - 1984-1986\r\nCW - 1986-1987\r\nLM - 1987 to present', 'No', 'None', 'yes', 'yes', 'yes', 'yes', 'yes', '-by God\'s grace and by faith\r\n-self-supporting like Apostle Paul (farming, one of our source of income)', '', 'Salvation is a gift of God. By Christ dying on the cross God paid it all for everyone, that whosoever believed and received it by faith, we will be saved. God did not saved us according to our works but according to His grace which was given to us before the world began.', 'It is in the unity of the Father, Son and Holy \r\nSpirit as three equal divine persons in one Godhead.\r\nFather -King of the heavens and the earth who punishes all sins but whose love sent His own Son to save us.\r\nSon -always with the Father, died on the cross to take away our sins, those who believe will be save\r\nHoly Spirit -always with the Father and the Son and with all the believers to guide and help us to draw people to God and to live according to His will.', 'From the moment we became Christians, we are  saved from hell and will not loss salvation as long as we have faith in Christ and we are in Christ. God\'s words says that we are saved by grace through faith in Christ Jesus and not by our own efforts or works. Eph 2:8-9, grace alone means that God loves, forgives and saves us not because of who we are or what we do, but because of the finished work of Christ.', 'March 31, 2021 11:37:am  ', 'Accepted', NULL, 'April 8, 2021 11:24:am  ', 'Submitted', NULL, NULL, 'Congratulations!\r\nYou passed the interview.'),
